alse\" name=\"No thanks\" />\n        </activiti:formProperty>\n        <activiti:formProperty id=\"duration\" name=\"Timer duration\" type=\"enum\" required=\"true\">\n          <activiti:value id=\"long\" name=\"One hour\" />\n          <activiti:value id=\"short\" name=\"10 seconds\" />\n        </activiti:formProperty>\n      </extensionElements>\n    </startEvent>\n\n    <sequenceFlow id=\"flow1\" sourceRef=\"theStart\" targetRef=\"exclusiveGw\" />\n\n    <exclusiveGateway id=\"exclusiveGw\" name=\"Exclusive Timer duration gateway\" />\n\n    <sequenceFlow id=\"flow2\" sourceRef=\"exclusiveGw\" targetRef=\"longTimerTask\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${duration == \'long\'}</conditionExpression>\n    </sequenceFlow>\n\n    <sequenceFlow id=\"flow3\" sourceRef=\"exclusiveGw\" targetRef=\"shortTimerTask\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${duration == \'short\'}</conditionExpression>\n    </sequenceFlow>\n\n    <userTask id=\"longTimerTask\" name=\"Task with timer on it\">\n      <documentation>This task has a timer on it</documentation>\n    </userTask>\n    <boundaryEvent id=\"longTimer\" cancelActivity=\"true\" attachedToRef=\"longTimerTask\">\n      <timerEventDefinition>\n        <timeDuration>PT1H</timeDuration>\n      </timerEventDefinition>\n    </boundaryEvent>\n\n    <sequenceFlow id=\"flow4\" sourceRef=\"longTimerTask\" targetRef=\"theEnd\" />\n    <sequenceFlow id=\"flow5\" sourceRef=\"longTimer\" targetRef=\"longTimerExpire\" />\n\n    <scriptTask id=\"longTimerExpire\" name=\"Execute script\" scriptFormat=\"groovy\">\n      <script>\n        if(throwException == \'true\') {\n          throw new java.lang.RuntimeException(\'Activiti Engine Rocks!\');\n        }\n      </script>\n    </scriptTask>\n\n    <sequenceFlow id=\"flow6\" sourceRef=\"longTimerExpire\" targetRef=\"theEnd\" />\n\n    <userTask id=\"shortTimerTask\" name=\"my task\">\n     \n    </userTask>\n    <boundaryEvent id=\"shortTimer\" cancelActivity=\"true\" attachedToRef=\"shortTimerTask\">\n      <timerEventDefinition>\n        <timeDuration>PT10S</timeDuration>\n      </timerEventDefinition>\n    </boundaryEvent>\n\n    <sequenceFlow id=\"flow7\" sourceRef=\"shortTimerTask\" targetRef=\"theEnd\" />\n    <sequenceFlow id=\"flow8\" sourceRef=\"shortTimer\" targetRef=\"shortTimerExpire\" />\n    \n    <scriptTask id=\"shortTimerExpire\" name=\"Execute script\" scriptFormat=\"js\">\n      <script>\n        if(throwException == \'true\') {\n          throw new java.lang.RuntimeException(\'Activiti Engine Rocks!\');\n        }\n      </script>\n    </scriptTask>\n\n    <sequenceFlow id=\"flow9\" sourceRef=\"shortTimerExpire\" targetRef=\"theEnd\" />\n\n    <endEvent id=\"theEnd\" />\n\n  </process>\n\n</definitions>\n',0),('29',1,'org/activiti/explorer/demo/process/FixSystemFailureProcess.bpmn20.xml','23','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions id=\"definitions\" \n  xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n  xmlns:activiti=\"http://activiti.org/bpmn\"\n  targetNamespace=\"Examples\">\n  \n  <process id=\"fixSystemFailure\" name=\"Fix system failure\">\n  \n    <startEvent id=\"theStart\" />\n    \n    <sequenceFlow id=\"flow1\" sourceRef=\"theStart\" targetRef=\"subProcess\" />\n    \n    <subProcess id=\"subProcess\">\n    \n      <startEvent id=\"subProcessStart\" />\n      <sequenceFlow id=\"flow2\" sourceRef=\"subProcessStart\" targetRef=\"subProcessFork\" />\n      \n      <parallelGateway id=\"subProcessFork\" />\n      <sequenceFlow id=\"flow3\" sourceRef=\"subProcessFork\" targetRef=\"task1\" />\n      <sequenceFlow id=\"flow4\" sourceRef=\"subProcessFork\" targetRef=\"task2\" />\n      \n      <userTask id=\"task1\" name=\"Investigate hardware\" activiti:candidateGroups=\"engineering\" />\n      <sequenceFlow id=\"flow5\" sourceRef=\"task1\" targetRef=\"subProcessJoin\" />\n      \n      <userTask id=\"task2\" name=\"Investigate software\" activiti:candidateGroups=\"engineering\" />\n      <sequenceFlow id=\"flow6\" sourceRef=\"task2\" targetRef=\"subProcessJoin\" />\n      \n      <parallelGateway id=\"subProcessJoin\" />\n      <sequenceFlow id=\"flow7\" sourceRef=\"subProcessJoin\" targetRef=\"subProcessEnd\" />\n      <endEvent id=\"subProcessEnd\" />\n    \n    </subProcess>\n    \n    <!-- Timer on subprocess -->\n    <boundaryEvent id=\"timer\" attachedToRef=\"subProcess\">\n      <timerEventDefinition>\n        <timeDuration>PT4H</timeDuration>\n      </timerEventDefinition>\n    </boundaryEvent>\n    <sequenceFlow id=\"flow8\" sourceRef=\"timer\" targetRef=\"taskAfterTimer\" />\n    <userTask id=\"taskAfterTimer\" name=\"Hand over to Level 2 support\" activiti:candidateGroups=\"management\" />\n    <sequenceFlow id=\"flow9\" sourceRef=\"taskAfterTimer\" targetRef=\"theEnd1\" />\n    <endEvent id=\"theEnd1\" />\n    \n    <sequenceFlow id=\"flow10\" sourceRef=\"subProcess\" targetRef=\"taskAfterSubProcess\" />\n    <userTask id=\"taskAfterSubProcess\" name=\"Write report\" activiti:candidateGroups=\"engineering\" />\n    <sequenceFlow id=\"flow11\" sourceRef=\"taskAfterSubProcess\" targetRef=\"theEnd\" />\n    <endEvent id=\"theEnd\" />\n    \n  </process>\n\n</definitions>',0),('30',1,'org/activiti/explorer/demo/process/simple-approval.bpmn20.xml','23','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n  xmlns:activiti=\"http://activiti.org/bpmn\" xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n  xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n  expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"Cool Processes\">\n  <process id=\"simpleApprovalProcess\" name=\"Simple approval process\">\n    \n    <documentation>This is a simple approval process.</documentation>\n    \n    <startEvent id=\"startevent2\" name=\"Start\" activiti:initiator=\"initiator\">\n      <extensionElements>\n        <activiti:formProperty id=\"approver\" name=\"Approver\" type=\"user\" required=\"true\" />\n        <activiti:formProperty id=\"duedate\" name=\"Approval due date\" datePattern=\"dd-MM-yyyy hh:mm\" type=\"date\" required=\"true\" />\n        <activiti:formProperty id=\"difficulty\" name=\"Difficulty (number)\" type=\"long\" />\n        <activiti:formProperty id=\"instructions\" name=\"Instructions\" type=\"string\" />\n      </extensionElements>\n    </startEvent>\n    \n    <userTask id=\"usertask2\" name=\"Approval task\" activiti:assignee=\"${approver}\" activiti:dueDate=\"${duedate}\">\n      <documentation>Approval request created by ${initiator}: ${instructions} </documentation>\n      <extensionElements>\n         <activiti:formProperty id=\"approved\" name=\"Decision\" type=\"enum\"\n          required=\"true\">\n          <activiti:value id=\"true\" name=\"Approve\" />\n          <activiti:value id=\"false\" name=\"Reject\" />\n        </activiti:formProperty>\n        <activiti:formProperty id=\"motivation\" name=\"Motivation\" type=\"string\" required=\"true\" />\n      </extensionElements>\n    </userTask>\n    <endEvent id=\"endevent2\" name=\"End\"></endEvent>\n    <sequenceFlow id=\"flow3\" name=\"\" sourceRef=\"startevent2\" targetRef=\"usertask2\"></sequenceFlow>\n    <sequenceFlow id=\"flow4\" name=\"\" sourceRef=\"usertask2\" targetRef=\"usertask3\"></sequenceFlow>\n    \n    <userTask id=\"usertask3\" name=\"Check outcome\" activiti:assignee=\"${initiator}\">\n      <documentation textFormat=\"text/plain\">Task completed by ${approver}: ${(approved.equals(\'true\')) ? \'Approved.\' : \'Rejected!\'}</documentation>\n      <extensionElements>\n         <activiti:formProperty id=\"motivation\" name=\"Motivation\" type=\"string\" writable=\"false\" />\n      </extensionElements>\n    </userTask>\n    <sequenceFlow id=\"flow5\" name=\"\" sourceRef=\"usertask3\" targetRef=\"endevent2\"></sequenceFlow>\n  </process>\n\n\n  <bpmndi:BPMNDiagram id=\"BPMNDiagram_simpleApprovalProcess\">\n    <bpmndi:BPMNPlane bpmnElement=\"simpleApprovalProcess\" id=\"BPMNPlane_simpleApprovalProcess\">\n      <bpmndi:BPMNShape bpmnElement=\"startevent2\" id=\"BPMNShape_startevent2\">\n        <omgdc:Bounds height=\"55\" width=\"55\" x=\"200\" y=\"180\"></omgdc:Bounds>\n      </bpmndi:BPMNShape>\n      <bpmndi:BPMNShape bpmnElement=\"usertask2\" id=\"BPMNShape_usertask2\">\n        <omgdc:Bounds height=\"55\" width=\"105\" x=\"320\" y=\"180\"></omgdc:Bounds>\n      </bpmndi:BPMNShape>\n      <bpmndi:BPMNShape bpmnElement=\"endevent2\" id=\"BPMNShape_endevent2\">\n        <omgdc:Bounds height=\"55\" width=\"55\" x=\"660\" y=\"180\"></omgdc:Bounds>\n      </bpmndi:BPMNShape>\n      <bpmndi:BPMNShape bpmnElement=\"usertask3\" id=\"BPMNShape_usertask3\">\n        <omgdc:Bounds height=\"55\" width=\"105\" x=\"490\" y=\"180\"></omgdc:Bounds>\n      </bpmndi:BPMNShape>\n      <bpmndi:BPMNEdge bpmnElement=\"flow3\" id=\"BPMNEdge_flow3\">\n        <omgdi:waypoint x=\"255\" y=\"207\"></omgdi:waypoint>\n        <omgdi:waypoint x=\"320\" y=\"207\"></omgdi:waypoint>\n      </bpmndi:BPMNEdge>\n      <bpmndi:BPMNEdge bpmnElement=\"flow4\" id=\"BPMNEdge_flow4\">\n        <omgdi:waypoint x=\"425\" y=\"207\"></omgdi:waypoint>\n        <omgdi:waypoint x=\"490\" y=\"207\"></omgdi:waypoint>\n      </bpmndi:BPMNEdge>\n      <bpmndi:BPMNEdge bpmnElement=\"flow5\" id=\"BPMNEdge_flow5\">\n        <omgdi:waypoint x=\"595\" y=\"207\"></omgdi:waypoint>\n        <omgdi:waypoint x=\"660\" y=\"207\"></omgdi:waypoint>\n      </bpmndi:BPMNEdge>\n    </bpmndi:BPMNPlane>\n  </bpmndi:BPMNDiagram>\n</definitions>',0),('31',1,'org/activiti/explorer/demo/process/VacationRequest.bpmn20.xml','23','<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n\n<definitions id=\"definitions\"\n             targetNamespace=\"http://activiti.org/bpmn20\" \n             xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n             xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n             xmlns:activiti=\"http://activiti.org/bpmn\">\n  \n  <process id=\"vacationRequest\" name=\"Vacation request\">\n  \n    <startEvent id=\"request\" activiti:initiator=\"employeeName\">\n      <extensionElements>\n        <activiti:formProperty id=\"numberOfDays\" name=\"Number of days\" type=\"long\" value=\"1\" required=\"true\"/>\n        <activiti:formProperty id=\"startDate\" name=\"First day of holiday (dd-MM-yyy)\" datePattern=\"dd-MM-yyyy hh:mm\" type=\"date\" required=\"true\" />\n        <activiti:formProperty id=\"vacationMotivation\" name=\"Motivation\" type=\"string\" />\n      </extensionElements>\n    </startEvent>\n    <sequenceFlow id=\"flow1\" sourceRef=\"request\" targetRef=\"handleRequest\" />\n    \n    <userTask id=\"handleRequest\" name=\"Handle vacation request\" >\n      <documentation>\n        ${employeeName} would like to take ${numberOfDays} day(s) of vacation (Motivation: ${vacationMotivation}).\n      </documentation> \n      <extensionElements>\n         <activiti:formProperty id=\"vacationApproved\" name=\"Do you approve this vacation\" type=\"enum\" required=\"true\">\n          <activiti:value id=\"true\" name=\"Approve\" />\n          <activiti:value id=\"false\" name=\"Reject\" />\n        </activiti:formProperty>\n        <activiti:formProperty id=\"managerMotivation\" name=\"Motivation\" type=\"string\" />\n      </extensionElements>\n      <potentialOwner>\n        <resourceAssignmentExpression>\n          <formalExpression>management</formalExpression>\n        </resourceAssignmentExpression>\n      </potentialOwner>         \n    </userTask>\n    <sequenceFlow id=\"flow2\" sourceRef=\"handleRequest\" targetRef=\"requestApprovedDecision\" />\n    \n    <exclusiveGateway id=\"requestApprovedDecision\" name=\"Request approved?\" />\n    <sequenceFlow id=\"flow3\" sourceRef=\"requestApprovedDecision\" targetRef=\"sendApprovalMail\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${vacationApproved == \'true\'}</conditionExpression>\n    </sequenceFlow>\n    \n    <task id=\"sendApprovalMail\" name=\"Send confirmation e-mail\" />\n    <sequenceFlow id=\"flow4\" sourceRef=\"sendApprovalMail\" targetRef=\"theEnd1\" />\n    <endEvent id=\"theEnd1\" />\n    \n    <sequenceFlow id=\"flow5\" sourceRef=\"requestApprovedDecision\" targetRef=\"adjustVacationRequestTask\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${vacationApproved == \'false\'}</conditionExpression>\n    </sequenceFlow>\n    \n    <userTask id=\"adjustVacationRequestTask\" name=\"Adjust vacation request\">\n      <documentation>\n        Your manager has disapproved your vacation request for ${numberOfDays} days.\n        Reason: ${managerMotivation}\n      </documentation>\n      <extensionElements>\n        <activiti:formProperty id=\"numberOfDays\" name=\"Number of days\" value=\"${numberOfDays}\" type=\"long\" required=\"true\"/>\n        <activiti:formProperty id=\"startDate\" name=\"First day of holiday (dd-MM-yyy)\" value=\"${startDate}\" datePattern=\"dd-MM-yyyy hh:mm\" type=\"date\" required=\"true\" />\n        <activiti:formProperty id=\"vacationMotivation\" name=\"Motivation\" value=\"${vacationMotivation}\" type=\"string\" />\n        <activiti:formProperty id=\"resendRequest\" name=\"Resend vacation request to manager?\" type=\"enum\" required=\"true\">\n          <activiti:value id=\"true\" name=\"Yes\" />\n          <activiti:value id=\"false\" name=\"No\" />\n        </activiti:formProperty>\n      </extensionElements>\n      <humanPerformer>\n        <resourceAssignmentExpression>\n          <formalExpression>${employeeName}</formalExpression>\n        </resourceAssignmentExpression>\n      </humanPerformer>  \n    </userTask>\n    <sequenceFlow id=\"flow6\" sourceRef=\"adjustVacationRequestTask\" targetRef=\"resendRequestDecision\" />\n    \n    <exclusiveGateway id=\"resendRequestDecision\" name=\"Resend request?\" />\n    <sequenceFlow id=\"flow7\" sourceRef=\"resendRequestDecision\" targetRef=\"handleRequest\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${resendRequest == \'true\'}</conditionExpression>\n    </sequenceFlow>\n    \n     <sequenceFlow id=\"flow8\" sourceRef=\"resendRequestDecision\" targetRef=\"theEnd2\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${resendRequest == \'false\'}</conditionExpression>\n    </sequenceFlow>\n    <endEvent id=\"theEnd2\" />\n      \n  </process>\n  \n</definitions>\n',0),('32',1,'org/activiti/explorer/demo/process/reviewSalesLead.bpmn20.xml','23','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n  xmlns:activiti=\"http://activiti.org/bpmn\"\n	xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" \n	xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n	xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" \n	xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" \n	targetNamespace=\"Examples\"\n	xsi:schemaLocation=\"http://www.omg.org/spec/BPMN/20100524/MODEL http://www.omg.org/spec/BPMN/2.0/20100501/BPMN20.xsd\">\n	\n	<error id=\"notEnoughInfoError\" errorCode=\"not_enough_info\" />\n	\n   <process id=\"reviewSaledLead\" name=\"Review sales lead\">\n   \n      <startEvent id=\"theStart\" activiti:initiator=\"initiator\" />\n      <sequenceFlow id=\"flow1\" sourceRef=\"theStart\" targetRef=\"provideNewSalesLead\"/>\n      \n      <userTask id=\"provideNewSalesLead\" name=\"Provide new sales lead\" activiti:assignee=\"${initiator}\">\n        <extensionElements>\n          <activiti:formProperty id=\"customerName\" name=\"Customer name\" type=\"string\" required=\"true\"/>\n          <activiti:formProperty id=\"potentialProfit\" name=\"Potential profit\" type=\"long\" />\n          <activiti:formProperty id=\"details\" name=\"Details\" type=\"string\